  "Sanction Details" : "THE CFTC ORDER DIRECTS: PARK TO CEASE AND DESIST FROM FURTHER VIOLATIONS OF THE CEA AND CFTC REGULATIONS; ORDERS PARK TO PAY RESTITUTION IN THE AMOUNT OF UP TO $35,000 AND A CIVIL MONETARY PENALTY OF UP TO $35,000 , PURSUANT TO A 10-YEAR PAYMENT PLAN; PROHIBITS PARK FROM APPLYING FOR REGISTRATION OR SEEKING EXEMPTION FROM REGISTRATION WITH THE CFTC IN ANY CAPACITY , AND ENGAGING IN ANY ACTIVITY REQUIRING SUCH REGISTRATION OR EXEMPTION FROM REGISTRATION, OR ACTING AS A PRINCIPAL, AGENT OR OFFICER OF ANY PERSON REGISTERED, EXEMPTED FROM REGISTRATION OR REQUIRED TO BE REGISTERTED WITH THE CFTC FOR A PERIOD OF SIX MONTHS; PROHIBITS PARK, FOR A PERIOD OF FIVE YEARS, FROM ACTING AS A PRINCIPAL , PARTNER, OFFICER, OR BRANCH OFFICE MANAGER OF ANY ENTITY REGISTERED OR REQUIRED TO BE REGISTERED WITH THE CFTC; AND DIRECTLY OR INDIRECTLY ACTING IN ANY SUPERVISORY CAPACITY OVER ANYONE REGISTERED OR REQUIRED TO BE REGISTERED; PROHIBITS PARK FROM TRADING ANY COMMODITY FUTURES CONTRACTS OR OPTIONS ON COMMODITY FUTURES CONTRACTS ON ANY CONTRACT MARKET FOR A PERIOD OF SIX MONTHS."
